import { Link } from "react-router-dom";

export default function Resume() {
  return (
    <footer>
    <h1>Footer</h1>

    <p style={{ paddingTop: "25px" }}>Welcome to the footer</p>
    <Link className="link" to="/">Back Home</Link>

    <p style={{ paddingTop: "25px" }}>Build + include links to social profiles: Twitter, YouTube, Technical Blog, LinkedIn, GitHub & Acknowledgements.</p>
    <p style={{ paddingTop: "15px" }}>Footer should be a solid color and fixed at the bottom of the screen.</p>
    </footer>
  );
}
